import { Card } from 'react-bootstrap';
// import { BsHeart, BsHeartFill } from 'react-icons/bs';
import { Link } from 'react-router-dom';
import Moment from 'react-moment';
import land_img from '../../assets/land.png';

function ProductCard({ params }) {
    return (
        <Card>
            <Link to={`/categories/land/${params._id}/details`}>
                <Card.Img variant="top" src={land_img} />
                <Card.Body>
                    <Card.Title>Land #{params._id}</Card.Title>
                    <Card.Text>{params.price} weth</Card.Text>
                </Card.Body>
            </Link>
            <Card.Footer>
                <small className="text-muted">
                    <Moment format="d MMM YYYY (dddd) HH:mm">
                        {params.addedAt}
                    </Moment>
                    -  <strong>{params.city}</strong>
                    <Link to="" id="heartIcon"><BsHeart /></Link>
                </small>
            </Card.Footer>
        </Card>
    )
}

export default ProductCard;
